import React from "react";

var x,y;

function Add(x,y){
    return x+y;
}

function Multiply(x,y){
return x*y;
}


function Subtract(x,y){
    return x-y;
}
function Division(x,y){
    return x/y;
}


export {Add,Multiply,Subtract,Division};
